          "snippet": {
            "videoId": "yuD34tEpRFw",
            "textDisplay": "Why would the Clocks hands appear to freeze when travelling at the speed of light?",
            "textOriginal": "Why would the Clocks hands appear to freeze when travelling at the speed of light?",
            "authorDisplayName": "Jeffrey Kaufmann",
            "authorProfileImageUrl": "https://yt3.ggpht.com/ytc/AMLnZu_HZnKHrIlMM3cn3fYjFQlrmS7IYxqK6pk1yg=s48-c-k-c0x00ffffff-no-rj",
