        "canReply": true,
        "totalReplyCount": 1,
        "isPublic": true
      },
      "replies": {
        "comments": [
          {
            "kind": "youtube#comment",
            "etag": "4M1ezC6yRAwD_kCnk2343zyFrvM",
            "id": "UgzDnde_TH1pD-303xR4AaABAg.9WtkUoU3gvs9X4b8GoVpg4",
            "snippet": {
              "videoId": "yuD34tEpRFw",
              "textDisplay": "Simple math, lightlike geodesics have proper time 0, they don't experience time (just like they don't experience space). A timelike geodesic however is kinda different as mass is involved, I can just explain with Lorentz transformations but you would be asking why Lorentz transformations, so I will tell you more details rather than simple facts.\n\nImagine a person A on the ground, he is completely still, in fact I would want A to be floating in the space but for the sake of understanding I will just say A is on the ground. Another person B is on a moving train, and he's got two mirrors with him, one's on the ceiling one's on the floor. Now we create a ray of light, bouncing between the mirrors vertically, B notices the light hit the same position every time, of course because the train is moving at constant velocitybut what would A see?\n\nA looks at the train and notices this light, the light hits the same position every timebut the train is moving, the light must move horizontally to catch the same point, so the velocity of light must have two portions, one is vertical, traveling between the ceiling and floor, the other one is vertical to keep up with the train.\n\nHowever, speed of light must be constant in vacuum and in every reference frame, B only sees the vertical speed, A also sees the horizontal speed, A would think light travels a lot faster than in B's opinion, this challenges our law of speed of light, so what happens? The time and space of each reference frame must be different so that physics can be consistent, B's time is slower, so when B notices the light goes from the ceiling and arrives at the floor, time measured by him is shorter than time measured by A, they would agree on the speed of light, and because time length is different, of course the total distance is different.\n\nAnd then I can answer your question, if an object with mass approaches speed of light, the time approaches zero, so it appears to be frozen, keep in mind tho that it won't actually reach the speed of light, that's only for massless objects, and massless objects can only travel at speed of light.",
