          "snippet": {
            "videoId": "yuD34tEpRFw",
            "textDisplay": "Lets say Einstein traveled for 10 seconds x 186, miles then he stopped !. His travel OUT clock would be plus ten seconds & the clock IN town would be plus10 seconds ; only Einstein couldn't see the town clock's 10 second gain yet ;  until after another 10 secs . Then Einstein could see the town clock with plus 10 secs ;  while simultaneously the IN town clock would reading 20 seconds ,  and after another 10 seconds Einstein would be able to see the town clock at 20 secs, ; of course in town it would be 30 seconds after  , & \nso forth & so forth the IN & OUT clocks would tick !\n . \nHow then has time slowed down , other then the visualization of the clock ? In the video illustration the  Einstein's moving faster through space , did not slow time ; it was rather observation of the light reflected off the town clock that took 10 secs. of time to reach his eyes , when he stopped moving !   \nThis concludes , isn't time effected , because the same time passed between the town clock & Einstein ; there are only different points of time observations .",
